tables.table_schema:
CREATE TABLE project_progress_logs (
 log_id SERIAL PRIMARY KEY,
 project_id UUID REFERENCES quantum_machine_learning_projects(project_id),
 log_date TIMESTAMP NOT NULL,
 log_description TEXT
);

CREATE TABLE project_logs (
    log_id INT PRIMARY KEY,
    project_id INT REFERENCES quantum_projects(project_id),
    log_date DATE NOT NULL,
    log_description TEXT
);

CREATE TABLE project_collaborators (
    collaborator_id INT PRIMARY KEY,
    project_id INT REFERENCES quantum_projects(project_id),
    collaborator_name TEXT NOT NULL,
    collaborator_role TEXT
);

CREATE TABLE project_logs (
  log_id INT PRIMARY KEY,
  project_id INT NOT NULL,
  log_date DATE NOT NULL,
  log_description TEXT
);

CREATE TABLE collaborators (
  collaborator_id INT PRIMARY KEY,
  collaborator_name VARCHAR(255) NOT NULL,
  email VARCHAR(255) NOT NULL,
  role VARCHAR(50) NOT NULL
);

CREATE TABLE progress_updates (
  update_id INT PRIMARY KEY,
  project_id INT NOT NULL,
  update_date DATE NOT NULL,
  update_content TEXT
);
